function 组装副本任务(对象)
{
	_root.委托任务界面.NPC任务_任务_起始帧 = null;
	var taskData = _root.getTaskData(对象.NPC任务_任务_关卡路径);
	_root.委托任务界面.taskData = taskData;
	_root.委托任务界面.NPC任务_任务_契约金 = taskData.deposit;
	_root.委托任务界面.NPC任务_任务_等级限制 = taskData.restricted_level;
	_root.委托任务界面.NPC任务_任务_K点 = taskData.Kdeposit;
	_root.SetDialogue(taskData.get_conversation);
	_root.委托任务界面.配置关卡属性(对象.NPC任务_任务_关卡路径);
	_root.委托任务界面.显示任务明细(taskData);
	_root.委托任务界面._visible = true;
}

function 买一杯酒(对象)
{
	if (对象.对话完毕)
	{
		return;
	}
	if (_root.金钱 >= 对象.价格)
	{
		_root.金钱 -= 对象.价格;
		_root.SetDialogue(对象.对话[对象.对话index], true);
		对象.对话index += 1;
		对象.显示文字 = "$" + 对象.价格 + " (" + 对象.对话index + "/" + 对象.对话.length + ")";
		if (对象.对话index >= 对象.对话.length)
		{
			对象.显示文字 = "SOLD OUT";
			对象.对话完毕 = true;
			对象.对话完毕回调函数();
		}
	}
	else
	{
		_root.发布消息("金钱不足！");
	}
}

